import React from 'react';
import catImage from "../image/cat.jpeg";

function HomePage() {
  return (
    <div>
      <div className='home'>
        <h2>Kei Nakamura</h2>
        <div className='home-aboutme'>
          <div className='home-aboutme-pic'>
            <img src={catImage}/>
            <div className='home-aboume-explanation'>
              21歳の時にVantan Techford Academyに入学しプログラミングを学び始めた現在22歳の学生。
              フロントエンジニアになるためにReactを勉強中。
              帰国子女のため英語話すことができる。
            </div>

            <div className='sub-portfolio'>
              Things I've been studying
            </div>

          </div>
        </div>
      </div>
    </div>
  )
};

export default HomePage;
